import React from "react";
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";
import nextArrow from "/Users/user/Desktop/hardwork/my-react-app/src/image/next.png";
import prevArrow from "/Users/user/Desktop/hardwork/my-react-app/src/image/back.png";

export default function ImageCard({ imageItem }, height, width) {
  return (
    <div style={{ height: height, width: width }}>
      <Carousel
        showThumbs={false}
        showStatus={false}
        showIndicators={false}
        infiniteLoop={true}
        autoPlay={false}
        renderArrowPrev={(onClickHandler, hasPrev, label) =>
          hasPrev && (
            <button
              type="button"
              onClick={onClickHandler}
              title={label}
              style={{
                position: "absolute",
                top: "50%",
                transform: "translateY(-50%)",
                backgroundColor: "transparent",
                color: "black",
                border: "none",
                cursor: "pointer",
                height: "100%",
                zIndex: "10",
                filter: "invert(1)",
              }}
            >
              <img
                src={prevArrow}
                alt="Previous"
                style={{ width: "15px", height: "15px" }}
              />
            </button>
          )
        }
        renderArrowNext={(onClickHandler, hasNext, label) =>
          hasNext && (
            <button
              type="button"
              onClick={onClickHandler}
              title={label}
              style={{
                position: "absolute",
                right: "0px",
                top: "50%",
                transform: "translateY(-50%)",
                color: "white",
                border: "none",
                cursor: "pointer",
                backgroundColor: "transparent",
                height: "100%",
                filter: "invert(1)",
              }}
            >
              <img
                src={nextArrow}
                alt="Next"
                style={{ width: "15px", height: "15px" }}
              />
            </button>
          )
        }
      >
        {imageItem.images.map((item, index) => (
          <div>
            <img src={item.image} alt="sample1" style={{ height: "200px" }} />
          </div>
        ))}
      </Carousel>
    </div>
  );
}
